import {useContext} from 'react'
import { Boss } from './Puplic'

export default function MiniMapping() {
    const {joky} = useContext(Boss)

  return (
    joky.map(x => 
   <>
    <li key={x.id} 
    style={{
        listStyle
    }}>
    <div>{x.image}</div>
    <div>
    <span>{x.name}</span>
    <span>{x.year}</span>
    </div>
    </li> 
  </>
  ))
    }
